import { getAllPosts } from "../lib/api";

const HomePage = (props) => {
    console.log(props);
    return (
        <div>
            Coucou la famille!
        </div>
    );
};

// eslint-disable-next-line @typescript-eslint/require-await
export async function getStaticProps() {
    const posts = getAllPosts([
        'title',
        'date',
        'slug',
        'author',
        'coverImage',
        'excerpt',
    ]);
    return {
        props: {
            posts,
        }
    };
}

export default HomePage;
